sources.scss/components/audioplayer.scss:
.audioplayer {
  z-index: 10;
  padding: 0.5em 0em;
  padding-bottom: 0.35em;
  background: #d5d5d5;
  font-size: 0.8em;
  width: 100%;
  position: sticky;
  top: 30px;
  border-bottom: dashed 1px rgba(0, 0, 0, 0.25);

  &__controls {
    width: 48px;
    text-align: right;
    float: left;
    padding-left: 1em;
    padding-right: 1em;
    padding-top: 0.125rem;
    @media screen and (max-width: 768px) {
      width: 40px;
      padding-left: 0;
    }
    a {
      color: $Scolor;
      padding-right: 0.35em;
      &:hover {
        cursor: pointer;
        color: $Pcolor;
      }
    }
  }
  &__timeline {
    position: relative;
    top: 2px;
    height: 16px;
    width: calc(100% - 200px);
    display: inline-block;
    white-space: nowrap;
    @media screen and (max-width: 768px) {
      width: calc(100% - 145px);
      padding-right: 0;
    }
  }
  &__loading {
    background-image: url(../images/Loading_new5.gif);
    width: 100%;
    display: block;
    height: 15px;
    opacity: 0.25;
    position: absolute;
  }
  &__meta {
    text-align: right;
    position: relative;
    top: -0.25rem;
    display: inline-block;
    right: 0;
    padding-left: 1em;
    white-space: nowrap;
    width: 60px;
    @media screen and (max-width: 768px) {
      width: 30px;
      padding-right: 0;
    }
    a {
      color: $Scolor;
      padding-left: 0.35em;
      &:hover {
        cursor: pointer;
        color: $Pcolor;
      }
    }
    @media screen and (max-width: 768px) {
      a {
        display: none;
      }
    }
  }
  .audio-loader {
    display: none;
    color: $Scolor;
    padding: 0 0.25rem;
  }
  &--archive {
    transform: translateY(-40px);
    z-index: 9999;
    position: fixed;
    width: 100%;
    transition: transform linear 0.2s, opacity 0.2s linear;
    opacity: 0;
    pointer-events: none;
    &.is-active {
      opacity: 1;
      pointer-events: auto;
    }
  }
}
body.is-playing {
  .audioplayer--archive {
    transform: translateY(0px);
  }
  &.down {
    .audioplayer--archive {
      transform: translateY(30px);
    }
  }
}

body.audio-loading {
  .audioplayer__controls {
    opacity: 0.25;
  }
  .audio-loader {
    display: inline-block;
  }
  wave {
    opacity: 0;
  }
}

body.no-track {
  .audioplayer {
    display: none;
  }
}

