sources.scss/pages/archive.scss:
.archive {
  margin: auto;
  padding-bottom: $gutter;
  margin-top: $gutter;
  &__loading {
    margin-bottom: $gutter;
    color: $Scolor;
  }
  &__item {
    opacity: 0;
    transition: opacity linear 0.2s;
    margin-bottom: $gutter;
    padding: 1rem;
    width: 420px;
    @media only screen and (max-width: 480px) {
      margin: auto;
      width: 300px;
      padding: 0em 1em;
      margin-bottom: $gutter;
    }
