      max-height: 135px;
      @media only screen and (max-width: 480px) {
        width: 100px;
      }
    }
    &__title {
      margin: 0;
      padding: 0;
      text-decoration: underline;
      line-height: 1.2em;
      hyphens: auto;
      font-size: 1.8em;
      @media only screen and (max-width: 480px) {
        font-size: 1.8em;
      }
    }
    &__client,
    &__year {
      display: inline-block;
      padding: 0;
      margin: 0;
      padding-bottom: 5px;
      padding-top: 4px;
      @media only screen and (max-width: 480px) {
        font-size: 1em;
      }
    }
    &__play {
      padding-left: 0.5em;
      i {
